import 'package:ieca_mobile/_import.dart';

class UmHymnsAmalehe {
  static List<HymnsContent> list =[
    HymnsContent(id: 2190, position: 1, content: "Oluali lua posoka\nLueyuka lesanju,\nPuãi ame ka lu ñela\nOmo lu takata.\nEsanju liange lieli,\nOsimbu ñasimo,\nOku kuama Ñala Yesu\nOtembo yosi.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_140, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2191, content: "Ha kuama kuama Yesu,\nHa kuama kuama Yesu,\nHa kuama kuama Yesu,\nOtembo yosi.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_140, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2192, position: 2, content: "Ndumalehe puãi haimo\nVungende nda wila\nVati, o ka sanga upongo\nEci kua pitilile.\nVati, kuli olohali\nLovitangi via lua,\nAme puãi ñuama Yesu\nOtembo yosi.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_140, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2193, position: 3, content: "Ndikangende ocili\nEvi viosi sanga,\nHa vi tuala ku Yesu,\nEye o ci yevite.\nOcili o ngohela,\nO muenya asuelela,\nOco lesanju ndu kuama\nOtembo yosi.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_140, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2194, position: 4, content: "Oco ohali ka yi nela\nPamue ocinjoko,\nLa Yesu ocituke\nSi sumbi upongo.\nNdaño okufa ku nyola,\nEteke minduka,\nHa kala la Ñala Yesu,\nOtembo yosi.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_140, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2195, position: 1, content: "A Cinyi cokovailu,\nA Suku o tela cosi,\nOsikola yetu\nHi sumuluisa a Tate.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_141, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2196, position: 2, content: "Ovitima vietu vi yule,\nOvisimilo vivi;\nTu ihe esumuluho,\nLi tunda kombembua yove.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_141, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2197, position: 3, content: "Ukulihiso wa lua\nLocinyi ca pua evelo,\nVi tu vokiyiwe\nPoku tu iha ombembua yove.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_141, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2198, position: 4, content: "Eci ovipama vi pua,\nTu enda lesanju lia lua;\nTu ka talavaya\nLovitima via li tumbika.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_141, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2199, position: 5, content: "Vuyaki wetu womuenyo\nTu ihe esumuluho,\nToke tu pitila,\nKofeka yohuminyo.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_141, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2200, position: 1, content: "Elaleko lietu liwa\nLioku kuama Onjovoli.\nTuamamako lonjolela,\nMomo Yesu tuo kolela.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_142, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2201, position: 2, content: "Elavoko lietu liwa\nLia tu sila Ñala Yesu.\nLioku linga olonungi\nVimbo liaye liokovailu.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_142, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2202, position: 3, content: "Oseteko yetu yiwa\nYoku setukula Yesu.\nNda tu u vumba locisola\nO tu ikisa esunga liaye.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_142, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2203, position: 4, content: "Oku vumba kuetu kuwa\nKa ku kumi otembo yosi.\nCime cetu ukuahenda\nPeka liaye pa salala.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_142, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2204, position: 5, content: "Ohuminyo yetu yiwa\nHayo ya posoka ca lua.\nYiti, oloneke viosi\nAme ñasi lene kumue.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_142, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2205, position: 1, content: "Nda yeva ondaka ya Yesu\nNdomo a ñovonga lohenda,\nSi wila vonjila yiwa\nMu kuete onima yocili.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_143, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2206, content: "Ngameko lesanju\nVonjila a njilika.\nNgameko lepandi\nSi kuata onima yocili.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_143, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2207, position: 2, content: "Ndukuaku livela utima\nWoku litumbika ocili.\nSi lingi onding’upange\nKa yi kutisiwa osõi.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_143, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2208, position: 3, content: "Si kuete ongusu ya piãla,\nSukila usongui wocili.\nSanga ndi pambuka vonjila\nYina yi songuila ku Suku.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_143, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2209, position: 4, content: "Oco ngameko lepandi,\nSi ka tokokele ohali.\nNjuvule evi vi mambuisa\nVonjila yina yocili.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_143, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2210, position: 1, content: "Akuenje, ca posoka\nOku vumba Suku!\nLomuenyo ou welipua\nOku loña kilu;\nKo ka lendi  kuendi\nKu Kristu Upopeli;\nYilo oyo otembo,\nYo ku tila onjembo.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_144, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2211, position: 2, content: "Nye wu vumbili Suku\nEci wa kuki ale?\nHelie wo sapuiliko\nOkuti upitili?\nOmuenyo wumaheye\nU pita lombili;\nLupuki yayuliko,\nLieci ya ku Ñala.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_144, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2212, position: 3, content: "Okulikandangiya\nOku vumba Suku;\nOkusia ekandu leviho\nEci wa kuki ale!\nNda wa tilisi itima\nKupange wa Ñala\nIvaluki okuti\nSuku o ka vu pisa.", hymnsNumber: UmHymnsNumberSeeder.AMALEHE_144, typeStanza: HymnsContentCode.VERSE),
  ];
}